import Postlist from './Postlist';
import Postdetail from './Postdetail'
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';



function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/"  component={Postlist} />
      </Router>
    </div>
  );
}

